create table type_test
(
    col_id            serial                                                                              not null
        constraint type_test_pk
            primary key,
    col_int           integer                                                                             not null,
    col_int_n         integer,
    col_varchar       varchar(255)                                                                        not null,
    col_varchar_n     varchar(255),
    col_blob          bytea                                                                               not null,
    col_blob_n        bytea,
    col_date          date                     default '2016-07-31'::date                                 not null,
    col_date_n        date,
    col_timestamp     timestamp                default '2016-07-31 00:00:00'::timestamp without time zone not null,
    col_timestamp_n   timestamp,
    col_timestamptz   timestamp with time zone default '2016-07-31 00:00:00+00'::timestamp with time zone not null,
    col_timestamptz_n timestamp with time zone,
    col_time          time                     default '12:00:00'::time without time zone                 not null,
    col_time_n        time,
    col_timetz        time with time zone      default '12:00:00+00'::time with time zone                 not null,
    col_timetz_n      time with time zone
);

alter table type_test
    owner to sq;

create unique index type_test_col_id_uindex
    on type_test (col_id);

